import aboutus_image from "../images/aboutus.jpg";

const AboutUs = () => {
  return (
    <div className="text-center">
      <div class="card mt-2" style={{ width: "18rem" }}>
        <img src={aboutus_image} class="card-img-top" alt="about_us_pic" />
        <div class="card-body">
          <h5 class="card-title">About Us</h5>
          <p class="card-text">
            <b>Code With Murad</b> is Youtube Channel, Where we upload all our
            software projects for students so that they can use it for learning
            purpose and Submission purpose in their Univerties.{" "}
          </p>
        </div>
      </div>
    </div>
  );
};

export default AboutUs;
